import React, { useEffect, useState } from 'react'
import Card from './Card'
import './index.css'
import Loading from './Loading'

const App = () => {

  const [data,setdata] = useState([])
  const [load,setload] = useState(true)

useEffect(() => {
fetch_data()
}, [])

const fetch_data = async () => {
  try {
    setload(false)
    const response = await fetch('https://jonplaceholder.typicode.com/albums/1/photos')
    const actual_data = await response.json()
    setdata(actual_data)
  } catch (error) {
    console.log(error)
  }
}

if (load) {
return  <Loading/>
}

 
  return (
    <div className='app' >
      <div className='container-fluid py-5  '>

        <div className="row g-lg-3 g-4">
          {
            data.map((curElem) => <Card key={curElem.id} card_data={curElem
            } />)
          }


        </div>

      </div>
    </div>
  )
}

export default App
